import React, { useEffect, useState } from 'react';
import { API_URL } from './api/api-key';
import MovieBox from './MovieBox';
import './App.css';


function App() {

const [movies, setMovies ] = useState([])

useEffect(() =>{
   fetch(API_URL)
   .then(resp => resp.json())
   .then(data =>{
      console.log(data)
      setMovies(data.results)
   })

},[])

  return (
    <div className="App">
     {movies.map((movie)=><MovieBox key={movie.id}/>)}  
     <h1>Movie</h1>

    </div>
  );
}

export default App;
